import Link from "next/link";
import Header from "../components/header";
import Form from "../components/Form";
import react from "react";

function Index() {
  return (
    <main>
      <Header />
      <Form />
      <style jsx>{`
      body{
        background:url("https://res.cloudinary.com/hj1ycojsg/image/upload/v1550166686/OllieTheSpotLandingPage.png");
      }
    `}</style>
    </main>
  );
}

export default Index;
